import React, { useEffect, useState } from "react";

const Table = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        setData(data.data);
      });
  }, []);

  return (
    <>
      <h1 className="text-center my-3 font-weight-bold">API TABLE</h1>
      <div className='text-center'>
            <button className="dark"><NavLink to="/register" className="text-decoration-none  text-light">Add Product</NavLink></button>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Gender</th>
            <th>Income</th>
            <th>City</th>
            <th>Car</th>
            <th>Quote</th>
            <th>Phone price</th>
          </tr>
        </thead>
        <tbody>
          {data.map((d) => {
            var currency = d.income;
            var income = Number(currency.replace(/[^0-9.-]+/g, ""));
            var money = d.phone_price;
            var price = Number(money.replace(/[^0-9.-]+/g, ""));
            if (
              (income < 5.0 &&
                (d.car === "BMW" || d.car === "Mercedes-Benz")) ||
              (d.gender === "Male" && price > 10000) ||
              (d.last_name.substring(0, 1) === "M" &&
                d.quote.length > 15 &&
                d.email.includes(`${d.last_name.toLowerCase()}`)) ||
              ((d.car === "BMW" ||
                d.car === "Mercedes-Benz" ||
                d.car === "Audi") &&
                !/\d/.test(d.email))
            ) {
              return (
                <tr>
                  <td>{d.id}</td>
                  <td>{d.first_name}</td>
                  <td>{d.last_name}</td>
                  <td>{d.email}</td>
                  <td>{d.gender}</td>
                  <td>{d.income}</td>
                  <td>{d.city}</td>
                  <td>{d.car}</td>
                  <td>{d.quote}</td>
                  <td>{d.phone_price}</td>
                </tr>
              );
            }
          })}
        </tbody>
      </table>
    </>
  );
};

export default Table;
